import React from 'react';

export const getTree = async (id) => {
    let res = await fetch(`${process.env.PUBLIC_URL}/calculate_tree?tree_id=${id}`);
    return await res.json();

}

export const getAllData = async () => {
    let res = await fetch(`${process.env.PUBLIC_URL}/calculate_tree`);
    return await res.json();

}
